MI LES MEILLEURS DU MONDE ! La filière Biopartenaire assure des revenus justes et un accompagnement vers l\'autonomie aux 1500 exploitations familiales partenaires qui cultivent 5500 ha de cacaouers bio au o a -', '', '39', '22', '47', '46', '2.7', '7.7', '0.2', '0.078740157480315', '', '0');

