VALUES ('3700579036253', 'Tarte figues et pruneaux à l’Armagnac', 'Pâte sablée [farine de _blé_, _beurre_, sucre glace, _œufs_, levure déshydratée(levure, émulsifiant : E491)], purée de figues 22,3% (figues 20%, sucre), _lait_ demi-écrémé, pruneaux 6,9%, _crème_ liquide (_crème_, stabilisant : E407), purée de framboises 4,4% (framboises 3,9%, sucre), sucre, Armagnac alc. 11,9% Vol, nappage (eau, sirop de glucose, sucre, gélifiants : pectines, carraghénane, gomme xanthane, acidifiant : acide citrique, conservateur : sorbate de potassium), _œufs_ entiers, jaune d\'_œufs_, jus concentré de citron jaune, beurre de cacao, préparation gélifiante (sucre, gélifiants : pectine et carraghénane, épaississant : amidon modifié de pomme de terre, correcteur d\'acidité : citrate de sodium), préparation pour crème pâtissière (amidon de maïs, sucre, arôme vanille, colorant naturel : E160a).', 'https://static.openfoodfacts.org/images/products/370/057/903/6253/front_fr.11.400.jpg', '12', '7.5', '36', '20', '1.5', '4.1', '0.08', '0.031496062992126', '', '1');

